import React, {Component} from "react";

class Test extends Component{
    state = {
        user:"Guest"
    }
    render(){
        return(
            <div>
                <h2>Welcome : {this.state.user}</h2>
                <h1>Enter your name:</h1>
                <input type="text" defaultValue="koko"></input>
                <button>change name</button>
            </div>
        )
    }
}

export default Test;
